import { Navigate, createBrowserRouter } from "react-router-dom";
import Header from './Header'
import About from "./About";
import Infopage from "./Infopage";
import Contact from "./Contact";

export const Home = createBrowserRouter([
	{
		path: "/home",
		element: <Header />,
		children: [
			{
				path: "/home",
				element: <Header />,
			},
			{
				path: "home/products",
				element: <About />,
			},
			{
				path: "home/about",
				element: < Infopage/>,
			},
			{
				path: "/contact",
				element: <Contact />,
			},
		],
	},
]);
export default Home;
